import { useParams } from "react-router-dom";
import useFetch from "./useFetch";

const AthleteDetails = () => {
    const { sport } = useParams();
    const { data: athlete, error, isPending } = useFetch('http://localhost:3030/athletes?' + sport)

    return (
        <>
        <section>
            {isPending && <p>Loading athlete detials...</p>}
            {error && <p>{error}</p>}
            {athlete && (
                <div>
                    <h1>{athlete.name}</h1>
                    <h2>{athlete.sport}</h2>
                    <h2>{athlete.data}</h2>
                </div>
            )}
        </section>
        </>
    )
}

export default AthleteDetails
